    'help.WhatAreThingsThatPotentiallyFraudulentSellersDo': '\u0BAE\u0BCB\u0B9A\u0B9F\u0BBF\u0BAF\u0BBE\u0BA9 \u0BB5\u0BBF\u0BB1\u0BCD\u0BAA\u0BA9\u0BC8\u0BAF\u0BBE\u0BB3\u0BB0\u0BCD\u0B95\u0BB3\u0BCD \u0B9A\u0BC6\u0BAF\u0BCD\u0BAF\u0B95\u0BCD\u0B95\u0BC2\u0B9F\u0BBF\u0BAF \u0B9A\u0BC6\u0BAF\u0BB2\u0BCD\u0B95\u0BB3\u0BCD \u0B8E\u0BB5\u0BC8?',
