    'about.AboutText1': 'OLX \u0B86\u0BA9\u0BA4\u0BC1, \u0BB5\u0BB3\u0BB0\u0BCD\u0BA8\u0BCD\u0BA4\u0BC1\u0BB5\u0BB0\u0BC1\u0BAE\u0BCD \u0B95\u0BC8\u0BAA\u0BCD\u0BAA\u0BC7\u0B9A\u0BBF \u0BAE\u0BB1\u0BCD\u0BB1\u0BC1\u0BAE\u0BCD \u0B87\u0BA3\u0BC8\u0BAF\u0B9A\u0BCD \u0B9A\u0BA8\u0BCD\u0BA4\u0BC8\u0B95\u0BB3\u0BCD \u0B87\u0BB0\u0BA3\u0BCD\u0B9F\u0BBF\u0BA9\u0BCD \u0BAE\u0BC0\u0BA4\u0BC1\u0BAE\u0BCD \u0B95\u0BB5\u0BA9\u0BAE\u0BCD \u0B9A\u0BC6\u0BB2\u0BC1\u0BA4\u0BCD\u0BA4\u0BC1\u0B95\u0BBF\u0BA9\u0BCD\u0BB1, \u0B89\u0BB2\u0B95\u0BBF\u0BA9\u0BCD \u0BAE\u0BC1\u0BA9\u0BCD\u0BA9\u0BA3\u0BBF \u0BB5\u0BB0\u0BBF\u0BB5\u0BBF\u0BB3\u0BAE\u0BCD\u0BAA\u0BB0 \u0B87\u0BAF\u0B95\u0BCD\u0B95\u0BC1\u0BA4\u0BB3\u0BAE\u0BBE\u0B95\u0BC1\u0BAE\u0BCD',
    'about.AboutText2': 'OLX \u0B89\u0BB2\u0B95\u0BB3\u0BB5\u0BBF\u0BB2\u0BCD 40-\u0B95\u0BCD\u0B95\u0BC1\u0BAE\u0BCD \u0BAE\u0BC7\u0BB1\u0BCD\u0BAA\u0B9F\u0BCD\u0B9F \u0BA8\u0BBE\u0B9F\u0BC1\u0B95\u0BB3\u0BBF\u0BB2\u0BCD \u0B87\u0BAF\u0B99\u0BCD\u0B95\u0BC1\u0B95\u0BBF\u0BB1\u0BA4\u0BC1',
    'about.about_Body': '"<p>OLX\u0B8E\u0BA9\u0BCD\u0BAA\u0BA4\u0BC1 \u0B85\u0B9F\u0BC1\u0BA4\u0BCD\u0BA4 \u0BA4\u0BB2\u0BC8\u0BAE\u0BC1\u0BB1\u0BC8 \u0B87\u0BB2\u0BB5\u0B9A \u0B87\u0BA3\u0BC8\u0BAF \u0BB5\u0BB0\u0BBF \u0BB5\u0BBF\u0BB3\u0BAE\u0BCD\u0BAA\u0BB0\u0B99\u0BCD\u0B95\u0BB3\u0BBE\u0B95\u0BC1\u0BAE\u0BCD.<br /><br />\u0BA8\u0BC0\u0B99\u0BCD\u0B95\u0BB3\u0BCD \u0B8E\u0B99\u0BCD\u0B95\u0BC1 \u0BB5\u0B9A\u0BBF\u0B95\u0BCD\u0B95\u0B95\u0BCD\u0B95\u0BC2\u0B9F\u0BBF\u0BAF\u0BB5\u0BB0\u0BBE\u0B95 \u0B87\u0BB0\u0BC1\u0BAA\u0BCD\u0BAA\u0BBF\u0BA9\u0BC1\u0BAE\u0BCD, \u0BB5\u0BBF\u0BB1\u0BCD\u0BAA\u0BA4\u0BC1, \u0BB5\u0BBE\u0B99\u0BCD\u0B95\u0BC1\u0BB5\u0BA4\u0BC1, \u0BB5\u0BB0\u0BCD\u0BA4\u0BCD\u0BA4\u0B95\u0BAE\u0BCD \u0B9A\u0BC6\u0BAF\u0BCD\u0BB5\u0BA4\u0BC1, \u0B95\u0BB2\u0BA8\u0BCD\u0BA4\u0BC1\u0BB0\u0BC8\u0BAF\u0BBE\u0B9F\u0BC1\u0BB5\u0BA4\u0BC1, \u0B92\u0BB4\u0BC1\u0B99\u0BCD\u0B95\u0BC1\u0BAA\u0B9F\u0BC1\u0BA4\u0BCD\u0BA4\u0BC1\u0BB5\u0BA4\u0BC1, \u0BAE\u0BB1\u0BCD\u0BB1\u0BC1\u0BAE\u0BCD \u0B89\u0B99\u0BCD\u0B95\u0BB3\u0BC1\u0B95\u0BCD\u0B95\u0BC1 \u0B85\u0BB0\u0BC1\u0B95\u0BBE\u0BAE\u0BC8\u0BAF\u0BBF\u0BB2\u0BC1\u0BB3\u0BCD\u0BB3 \u0BAE\u0B95\u0BCD\u0B95\u0BB3\u0BC8\u0B9A\u0BCD \u0B9A\u0BA8\u0BCD\u0BA4\u0BBF\u0BAA\u0BCD\u0BAA\u0BA4\u0BC1 \u0B86\u0B95\u0BBF\u0BAF\u0BB5\u0BB1\u0BCD\u0BB1\u0BBF\u0BB2\u0BCD \u0B89\u0BB3\u0BCD\u0BB3 \u0B9A\u0BBF\u0B95\u0BCD\u0B95\u0BB2\u0BCD\u0B95\u0BB3\u0BC1\u0B95\u0BCD\u0B95\u0BC1 \u0B92\u0BB0\u0BC1 \u0B8E\u0BB3\u0BBF\u0BAF \u0BA4\u0BC0\u0BB0\u0BCD\u0BB5\u0BC8 OLX \u0B85\u0BB3\u0BBF\u0B95\u0BCD\u0B95\u0BBF\u0BB1\u0BA4\u0BC1.<br /><br />OLX -\u0BB2\u0BCD \u0BA8\u0BC0\u0B99\u0BCD\u0B95\u0BB3\u0BCD:<br /><ul><li>\u0BAA\u0B9F\u0B99\u0BCD\u0B95\u0BB3\u0BC8\u0B95\u0BCD \u0B95\u0BCA\u0BA3\u0BCD\u0B9F \u0BB5\u0BA3\u0BCD\u0BA3\u0BAE\u0BBF\u0B95\u0BC1 \u0BB5\u0BBF\u0BB3\u0BAE\u0BCD\u0BAA\u0BB0\u0B99\u0BCD\u0B95\u0BB3\u0BC8 \u0B8E\u0BB3\u0BBF\u0BA4\u0BBE\u0B95 \u0BB5\u0B9F\u0BBF\u0BB5\u0BAE\u0BC8\u0B95\u0BCD\u0B95 \u0BAE\u0BC1\u0B9F\u0BBF\u0BAF\u0BC1\u0BAE\u0BCD.</li><li>\u0B8E\u0BA9\u0BCD OLX -\u0BB2\u0BCD \u0B89\u0B99\u0BCD\u0B95\u0BB3\u0BCD \u0BB5\u0BBF\u0BB1\u0BCD\u0BAA\u0BA9\u0BC8, \u0BB5\u0BBE\u0B99\u0BCD\u0B95\u0BC1\u0BA4\u0BB2\u0BCD, \u0BAE\u0BB1\u0BCD\u0BB1\u0BC1\u0BAE\u0BCD \u0B9A\u0BAE\u0BC2\u0B95 \u0BA8\u0B9F\u0BB5\u0B9F\u0BBF\u0B95\u0BCD\u0B95\u0BC8\u0B95\u0BB3\u0BCD \u0B86\u0B95\u0BBF\u0BAF\u0BB5\u0BB1\u0BCD\u0BB1\u0BC8 \u0B95\u0B9F\u0BCD\u0B9F\u0BC1\u0BAA\u0BCD\u0BAA\u0B9F\u0BC1\u0BA4\u0BCD\u0BA4 \u0BAE\u0BC1\u0B9F\u0BBF\u0BAF\u0BC1\u0BAE\u0BCD</li><li>\u0B89\u0B99\u0BCD\u0B95\u0BB3\u0BCD \u0BB5\u0BBF\u0BB3\u0BAE\u0BCD\u0BAA\u0BB0\u0B99\u0BCD\u0B95\u0BB3\u0BC8 \u0B89\u0B99\u0BCD\u0B95\u0BB3\u0BCD \u0B9A\u0BAE\u0BC2\u0B95\u0BAA\u0BCD\u0BAA\u0BBF\u0BA3\u0BC8\u0BAF  \u0B9A\u0BC1\u0BAF\u0BB5\u0BBF\u0BB5\u0BB0\u0BA4\u0BCD\u0BA4\u0BBF\u0BB2\u0BCD (Facebook, Myspace, ...) \u0B95\u0BBE\u0B9F\u0BCD\u0B9A\u0BBF\u0BAA\u0BCD\u0BAA\u0B9F\u0BC1\u0BA4\u0BCD\u0BA4 \u0BAE\u0BC1\u0B9F\u0BBF\u0BAF\u0BC1\u0BAE\u0BCD</li><li>\u0BB5\u0BB2\u0BC8\u0BA4\u0BCD\u0BA4\u0BB3\u0BA4\u0BCD\u0BA4\u0BC8 \u0B89\u0B99\u0BCD\u0B95\u0BB3\u0BCD \u0B85\u0BB2\u0BC8\u0BAA\u0BC7\u0B9A\u0BBF\u0BAF\u0BBF\u0BB2\u0BCD \u0B87\u0BB0\u0BC1\u0BA8\u0BCD\u0BA4\u0BC1 \u0B85\u0BA3\u0BC1\u0B95 \u0BAE\u0BC1\u0B9F\u0BBF\u0BAF\u0BC1\u0BAE\u0BCD</li><li>OLX -\u0B90 \u0B89\u0B99\u0BCD\u0B95\u0BB3\u0BCD \u0B89\u0BB3\u0BCD\u0BB3\u0BC2\u0BB0\u0BCD \u0BAE\u0BCA\u0BB4\u0BBF\u0BAF\u0BBF\u0BB2\u0BCD \u0BAA\u0BBE\u0BB0\u0BCD\u0B95\u0BCD\u0B95 \u0BAE\u0BC1\u0B9F\u0BBF\u0BAF\u0BC1\u0BAE\u0BCD</li></ul><br /><<QTY_COUNTRIES>> \u0B95\u0BCD\u0B95\u0BC1\u0BAE\u0BCD \u0BAE\u0BC7\u0BB1\u0BCD\u0BAA\u0B9F\u0BCD\u0B9F \u0BA8\u0BBE\u0B9F\u0BC1\u0B95\u0BB3\u0BBF\u0BB2\u0BCD <<QTY_LANGUAGES>> \u0BAE\u0BCA\u0BB4\u0BBF\u0B95\u0BB3\u0BBF\u0BB2\u0BCD OLX \u0BAA\u0BAF\u0BA9\u0BCD\u0BAA\u0B9F\u0BC1\u0BA4\u0BCD\u0BA4\u0BAA\u0BCD\u0BAA\u0B9F\u0BC1\u0B95\u0BBF\u0BB1\u0BA4\u0BC1. \u0B87\u0BA8\u0BCD\u0BA4 \u0BA8\u0BBF\u0BB1\u0BC1\u0BB5\u0BA9\u0BAE\u0BCD \u0BAE\u0BBE\u0BB0\u0BCD\u0B9A\u0BCD 2006-\u0BB2\u0BCD \u0BA8\u0BBF\u0BB1\u0BC1\u0BB5\u0BAA\u0BCD\u0BAA\u0B9F\u0BCD\u0B9F\u0BA4\u0BC1 \u0BAE\u0BB1\u0BCD\u0BB1\u0BC1\u0BAE\u0BCD \u0B87\u0BA4\u0BC1 \u0B92\u0BB0\u0BC1 \u0BA4\u0BA9\u0BBF\u0BAF\u0BBE\u0BB0\u0BCD \u0BA8\u0BBF\u0BB1\u0BC1\u0BB5\u0BA9\u0BAE\u0BCD \u0B86\u0B95\u0BC1\u0BAE\u0BCD.</p>"',
